    res.json({
      success: true,
      data: result,
      model: aiResponse.model,
    });
  } catch (error) {
    console.error('Generate UI error:', error);
    res.status(500).json({
      success: false,
      error: error instanceof Error ? error.message : 'Unknown error',
    });
  }
